import React from "react";
import { ListGroup, Card, Accordion, Button } from 'react-bootstrap';
class MyEvent extends React.Component {
    render() {
        return (
            <div>
                <ListGroup>
                <ListGroupItem class="accordion arrows">
		<input type="radio" name="accordion" id="cb1" />
		<section class="box">
			<label class="box-title" for="cb1">Readme</label>
			<label class="box-close" for="acc-close"></label>
			<div class="box-content">Click on an item to open. Click on its header or the list header to close.</div>
		</section>	
	</ListGroupItem>
                </ListGroup>
            </div>
        )
    }
} export default MyEvent;
